import ReactDOM from 'react-dom/client';
import './index.css';

//創建JSX項目
const App = ()=>{
   
<div>
    <div className='logs'>
        <div className='item'>
            <div className='date'>
                <div className='month'>三月</div>
                <div className='day'>22</div>
            </div>

            <div className='content'>
                <h2 className='desc'>學習React</h2>
                <div className='time'>80分鐘</div>
            </div>

        </div>
    </div>
</div>;
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App/>);
